import {onClickAddPost, RootStateType, updateNewPostText} from "./Redax/state";
import ReactDOM from "react-dom";
import {BrowserRouter} from "react-router-dom";
import App from "./App";
import React from "react";

export const renderTree = (state: RootStateType) => {
    ReactDOM.render(
        <BrowserRouter>
            <App state={state} updateNewPostText={updateNewPostText}onClickAddPost={onClickAddPost}/>
        </BrowserRouter>, document.getElementById('root')
    );
}
